create table samqa.online_enrollment (
    enrollment_id              number,
    batch_number               varchar2(30 byte),
    first_name                 varchar2(300 byte),
    last_name                  varchar2(300 byte),
    middle_name                varchar2(300 byte),
    title                      varchar2(30 byte),
    gender                     varchar2(1 byte),
    birth_date                 date,
    ssn                        varchar2(300 byte),
    id_type                    varchar2(2 byte),
    id_number                  varchar2(300 byte),
    address                    varchar2(300 byte),
    city                       varchar2(300 byte),
    state                      varchar2(300 byte),
    zip                        varchar2(300 byte),
    phone                      varchar2(300 byte),
    email                      varchar2(300 byte),
    carrier_id                 number,
    carrier_name               varchar2(300 byte),
    plan_type                  varchar2(30 byte),
    health_plan_eff_date       date,
    deductible                 number,
    plan_code                  number,
    start_date                 date,
    broker_lic                 varchar2(30 byte),
    entrp_id                   number,
    fee_pay_type               number,
    er_contribution            number,
    ee_contribution            number,
    er_fee_contribution        number,
    ee_fee_contribution        number,
    contribution_frequency     varchar2(1 byte),
    debit_card_flag            varchar2(1 byte),
    user_name                  varchar2(300 byte),
    user_password              varchar2(300 byte),
    password_reminder_question varchar2(3000 byte),
    password_reminder_answer   varchar2(3000 byte),
    bank_name                  varchar2(3000 byte),
    routing_number             number,
    account_type               varchar2(3 byte),
    bank_account_number        varchar2(30 byte),
    enrollment_status          varchar2(30 byte),
    error_message              varchar2(3200 byte),
    ip_address                 varchar2(30 byte),
    pers_id                    number,
    acc_id                     number,
    acc_num                    varchar2(30 byte),
    creation_date              date default sysdate not null enable,
    created_by                 number default 421 not null enable,
    last_update_date           date default sysdate not null enable,
    last_updated_by            number default 421 not null enable,
    fraud_flag                 varchar2(3200 byte),
    lang_perf                  varchar2(30 byte) default 'ENGLISH',
    annual_election            number,
    division_code              varchar2(3200 byte),
    health_fsa_flag            varchar2(30 byte),
    hfsa_effective_date        varchar2(30 byte),
    hfsa_annual_election       number,
    dep_fsa_flag               varchar2(30 byte),
    dfsa_effective_date        varchar2(30 byte),
    dfsa_annual_election       number,
    transit_fsa_flag           varchar2(30 byte),
    transit_effective_date     varchar2(30 byte),
    transit_annual_election    number,
    parking_fsa_flag           varchar2(30 byte),
    parking_effective_date     varchar2(30 byte),
    parking_annual_election    number,
    bicycle_effective_date     varchar2(30 byte),
    bicycle_fsa_flag           varchar2(30 byte),
    bicycle_annual_election    number,
    post_ded_fsa_flag          varchar2(30 byte),
    post_ded_effective_date    varchar2(30 byte),
    post_ded_annual_election   number,
    action                     varchar2(30 byte),
    id_verification_status     varchar2(30 byte),
    idv_transaction_id         varchar2(30 byte),
    idv_transaction_date       varchar2(30 byte),
    enrollment_source          varchar2(255 byte),
    process_type               varchar2(1 byte) default 'E'
);

alter table samqa.online_enrollment add primary key ( enrollment_id )
    using index enable;


